import {Component, EventEmitter, Input, OnChanges, Output, SimpleChanges} from '@angular/core';
import {Question} from '../../models/question';
import {ApiClientService} from '../../api-client.service';

@Component({
    selector: 'app-run-game',
    templateUrl: './run-game.component.html'
})
export class RunGameComponent implements OnChanges {

    @Input()
    public question: Question;

    @Input()
    public lobby: string;

    @Input()
    public userToken: string;

    @Output()
    public questionAnsweredCorrectly = new EventEmitter();

    public runArray = [
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,'
    ];

    public background = 'data:image/png;base64,';

    public currentImage: any;
    public winningImage: any;
    public steps = 0;
    public stepsToFinish: number;
    public showIntro: boolean;
    public showOutro: boolean;
    public timeInSecondsTillStart: number;

    constructor(private apiClient: ApiClientService) {
        this.currentImage = this.runArray[1];
    }

    ngOnChanges(changes: SimpleChanges): void {
        this.steps = 0;
        this.timeInSecondsTillStart = undefined;
        this.currentImage = this.runArray[1];
        this.winningImage = undefined;
        this.stepsToFinish = this.question.requiredSteps;
        this.showIntro = true;
        setTimeout(() => {
            this.showIntro = false;
        }, 10000);
        this.countTimeInSeconds(10);
    }

    private countTimeInSeconds(time) {
        if (time <= 0) {
            return;
        }
        this.timeInSecondsTillStart = time;
        setTimeout(() => {
            this.countTimeInSeconds(time - 1);
        }, 999);
    }

    public run() {
        if (this.showIntro) {
            return;
        }
        this.currentImage = this.runArray[ (this.steps % this.runArray.length)];
        this.steps += 1;
        if (this.stepsToFinish <= this.steps) {
            this.currentImage = undefined;
            this.winningImage = 'data:image/png;base64,';
            this.showOutro = true;
            setTimeout(() => {
                this.showOutro = false;
            }, 2000);
            setTimeout(() => {
                this.apiClient.checkAnswer(this.lobby, this.userToken, this.question.uuid, []).subscribe((res: any) => {
                    // no chance to fail
                    this.questionAnsweredCorrectly.emit();
                });
            }, 6000);
        }
    }
}
